const SourceCreatePageExampleSourceGallery = (
  props: SourceCreatePageExampleSourceGalleryPropsType
) => {
  const [selectedTab, setSelectedTab] = useState<GalleryTabIdType>('news');

  const handleTabChange = useCallback(
    (
      newTabId: GalleryTabIdType,
      prevTabId: GalleryTabIdType | undefined,
      event: React.MouseEvent<HTMLElement, MouseEvent>
    ) => {
      setSelectedTab(newTabId);
    },
    []
  );

  return (
    <div className="data-providers__gallery">
      <Tabs
        id="data-providers__gallery__tabs"
        onChange={handleTabChange}
        selectedTabId={selectedTab}
        vertical
      >
        {galleryExampleSources.map((group) => (
          <Tab
            id={group.tabId}
            key={group.tabId}
            title={group.tabCaption}
            panel={
              <div className="data-providers__gallery__tabs__tab">
                <AutoAnimated additionalClassNames="data-providers__gallery__tabs__tab__inner">
                  {group.items.map((item, index) => (
                    <SourceCreatePageExampleSourceGalleryGridItem
                      key={index}
                      {...item}
                      onExampleSourceSelected={props.onExampleSourceSelected}
                    />
                  ))}
                </AutoAnimated>
              </div>
            }
          />
        ))}
      </Tabs>
    </div>
  );
};

export default SourceCreatePageExampleSourceGallery;
